import React from 'react';

const Project = (props) => {

    let codeLinkClass = "";
    let projectLinkClass = "";
    if(props.codeLink === ""){
        codeLinkClass = "hide"
    }
    if(props.projectLink === ""){
        projectLinkClass = "hide"
    }
    return (
        <div className="card">
            <h4>{props.title}</h4>
            <img width="120px" className="center" src={props.img} alt="fial"/>
            <p>{props.desc}</p>

            <div className="containerbtns flex-horizontal space-between">
            <a rel="noreferrer" className={projectLinkClass} target="_blank" href={props.projectLink}> View Project</a>
            
            <a rel="noreferrer" target="_blank" className={codeLinkClass} href={props.codeLink}> View Code</a>
            </div>
        </div>
    )
}

export default Project
